          <form className="form-control">
            <b style={{ color: "white",fontSize:"40px", fontFamily:"monotype corsiva" }}>Name: Debasish Travel Agency</b><br></br>
            <b style={{ color: "white",fontSize:"40px", fontFamily:"monotype corsiva" }}>Mobile No: 1234567898</b><br></br>
            <b style={{ color: "white",fontSize:"40px", fontFamily:"monotype corsiva" }}>Email id: dta@gmail.com</b><br></br>
            <b style={{ color: "white",fontSize:"40px", fontFamily:"monotype corsiva" }}>Facebook: Debasish Travel Agency</b><br></br>
             </form>
        </div>
      </section>
    </>
  );
};

export default Contact;
